import React from 'react';

const PronunciationTest = () => {
  return (
    <div className="text-center">
      <h1>洗手間</h1>



      <h3>How do you pronounce 洗手間?</h3>
      <div className="row">
        <div className="col-6">
          <div className="btn btn-block btn-secondary">Don't know</div>
        </div>
        <div className="col-6">
          <div className="btn btn-block btn-primary">Know</div>
        </div>
      </div>

    </div>
  )
}

export default PronunciationTest;
